import React from 'react';
import Users from './users/pages/Users';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
function App() {
   return (
      <Router>
         <Route path="/" component={Users} exact />
         <Redirect to="/" />
      </Router>
   );
}

export default App;
